import { Box, CircularProgress, Typography } from '@mui/material';

const LoadingScreen = () => {
    return (
        <Box mt={5}>
            <CircularProgress />
            <Typography variant="h5" mt={2}>
                Fetching...
            </Typography>
        </Box>
    );
};

export default LoadingScreen;
